var title_f13_22_13675="Stages of sarcoidosis";
var content_f13_22_13675=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F56321&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F56321&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Stages of radiographic involvement in pulmonary sarcoidosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Stage",
"       </td>",
"       <td class=\"subtitle1\">",
"        Radiographic findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        Bilateral hilar adenopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        II",
"       </td>",
"       <td>",
"        Bilateral hilar adenopathy and reticular opacities (predominantly in upper lobes)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        III",
"       </td>",
"       <td>",
"        Reticular opacities (predominantly in upper lobes) with shrinking hilar lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        IV",
"       </td>",
"       <td>",
"        Reticular opacities, volume loss, conglomerated masses with traction bronchiectasis. Calcification and cavitation or cyst formation may be present.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nodular sarcoid",
"       </td>",
"       <td>",
"        Multiple, bilateral lung nodules and minimal hilar adenopathy",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Scadding, JG. Prognosis of intrathoracic sarcoidosis in England: a review of 136 cases after five years' observation. BMJ 1961; 2:1165.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
