var title_f13_22_13676="Skull base tumors diff dx";
var content_f13_22_13676=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F53974&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F53974&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of tumors at the base of the skull",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Site of lesion",
"       </td>",
"       <td class=\"subtitle1\">",
"        Associated tumors",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anterior parts",
"       </td>",
"       <td>",
"        Carcinoma invasive from frontal and ethmoid sinuses; meningiomas",
"       </td>",
"       <td>",
"        Unilateral anosmia, frontal lobe syndrome, seizures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Superior orbital fissure",
"       </td>",
"       <td>",
"        Meningiomas, carcinoma of nasopharynx",
"       </td>",
"       <td>",
"        III, IV, V, VI cranial nerve lesions with ophthalmoplegia. Pain and hypesthesia in distribution of V.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cavernous sinus",
"       </td>",
"       <td>",
"        Chordomas, meningiomas, sellar, and parasellar tumors",
"       </td>",
"       <td>",
"        III, IV, VI, and sometimes V nerve involvement with ophthalmoplegia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Apex of the petrous temporal bone",
"       </td>",
"       <td>",
"        Cholesteatoma, chordoma, meningioma, neurinoma, sarcoma",
"       </td>",
"       <td>",
"        V and VI nerve involvement with sensory and motor findings and diplopia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sphenoid and petrous bone",
"       </td>",
"       <td>",
"        Meningioma, chordoma, nasopharyngeal carcinoma, metastasis",
"       </td>",
"       <td>",
"        III, IV, VI nerve lesions result in ophthalmoplegia; V may be associated with trigeminal neuralgia syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Jugular foramen",
"       </td>",
"       <td>",
"        Glomus jugulare tumors, neurinomas, chordomas, cholesteatoma, meningiomas, nasopharyngeal carcinoma",
"       </td>",
"       <td>",
"        IX, X, XI nerves producing difficulty with swallowing, speaking, and weakness of strap muscles of neck",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cerebellopontine angle",
"       </td>",
"       <td>",
"        Neurinoma, meningioma, cholesteatoma, metastasis cerebellar tumors",
"       </td>",
"       <td>",
"        VII nerve lesions causing loss of hearing, vertigo, and nystagmus; cerebellar lesions producing ataxia of limbs and gait; V, VII, and occasionally IX and XII nerve lesions; brainstem symptoms and signs of increased intracranial pressure",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Bingas, B. Tumors of the base of the skull. In: Vinken, PJ, Bruyn, GW (Eds), Handbook of Clinical Neurology: Tumors of the Brain and Skull, vol 17. Amsterdam, North Holland, 1974:136.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
